import React from 'react';
import { Link,useNavigate } from 'react-router-dom';

function Login() {
    const navigate = useNavigate();

  const handleLogin = () => {
    navigate('/SideBarMenu');
  };
  return (
    <div className='d-flex justify-content-center align-items-center vh-100'>
        <div className='bg-white p-4 rounded border border-4 w-25 '>
            <h3 className='text-center mb-2'>Login</h3>
            <form>
                <div className='mb-3'>
                    <label htmlFor="email" className="form-label"><strong>Email</strong></label>
                    <input type="email" className="form-control" id="email" placeholder='Enter your email' />
                </div>
                <div className='mb-3'>
                    <label htmlFor="password" className="form-label"><strong>Password</strong></label>
                    <input type="password" className="form-control" id="password" placeholder='Enter your password' />
                </div>
                <div className="mb-3 form-check">
                    <input type="checkbox" className="form-check-input" id="agree" />
                    <label className="form-check-label" htmlFor="agree">I agree to the terms and conditions</label>
                </div>
                <Link to={"/SideBarMenu"}  type="submit"  onClick={handleLogin}  className='btn btn-success w-100 rounded-4'>Login</Link>
                <p className="mt-3">Don't have an account? <button  className='btn btn-link'>Create Account</button></p>
            </form>
        </div>
    </div>
  );
}

export default Login;
